    "663c47a7c5244bc581088ee966a32cc9": {
      "model_name": "HTMLModel",
      "model_module": "@jupyter-widgets/controls",
      "model_module_version": "1.5.0",
      "state": {
        "_dom_classes": [],
        "layout": "IPY_MODEL_00cc99b11d8541d38b5c82e2b77553fa",
        "style": "IPY_MODEL_bb3244182d2d41c0ba1e79b260f72147",
        "value": "\n<style>\nh1 {\n  font-weight: bold;\n  color: #000;\n  font-size: 14px;\n}\n\nh2 {\n  font-weight: bold;\n  color: #000;\n  font-size: 13px;\n}\nh3 {\n  font-weight: bold;\n  color: #000;\n  font-size: 12px;\n}\n</style>\n<div><p>Download: <a href=\"GPX\\R\u00e4tsel-Rallye.gpx\">GPX File</a></p>\n\u003c!-- Farbe: '#00ff80' -->\n\n<h1>R\u00e4tsel Rallye</h1>\n<p>Details zur R\u00e4tsel-Rallye gibt es als <a href=https://umsteigenaufsteigen.de/wp-content/uploads/2020/06/STADTRADELN-R%C3%A4tsel-Rallye.pdf target=\\\"_blank\\\">PDF</a> beim Umweltzentrum Hannover </p>\n<p>Willkommen bei der ersten STADTRADELN-\nR\u00e4tsel-Rallye. Auf euch wartet eine ca. 25 km lange\nRadtour, bei der es Einiges zu entdecken und viele\nAufgaben zu l\u00f6sen gibt. Druckt euch also auf jeden\nFall vor dem Start der Tour unseren R\u00e4tselbogen aus.\nDamit macht die Tour gleich doppelt so viel Spa\u00df und\nbei richtiger L\u00f6sung der Fragen, erwarten euch viele\nwertvolle Sachpreise.</p>\n<p>Habt Ihr den Innenstadtbereich der Landeshauptstadt Hannover schon einmal fast ausschlie\u00dflich im\nGr\u00fcnen umrundet? Diese Tour erm\u00f6glicht euch genau\ndas. Mit vielen Rastm\u00f6glichkeiten eignet sich diese\nTour f\u00fcr die ganze Familie. Unsere R\u00e4tselaufgaben\nsorgen f\u00fcr Abwechslung, auch bei den Kleinen. Wem\ndiese Tour zu lang erscheint, kann Sie auch an\nmehreren Tagen in Teiletappen absolvieren.</p>\n<p>Die L\u00f6sungssumme der STADTRADELN-R\u00e4tsel-Rallye\nschickt ihr bitte bis zum 27.06.2020 per Mail an\ninfo@soulstyle.de. Unter allen Einsendungen werden\n wertvolle Preise verlost.</p>\n<p>\u00dcbrigens: Die Tour Navigation f\u00e4llt besonders leicht\nmit der Bike Citizens Navigations App der Region\nHannover. Diese k\u00f6nnt ihr kostenlos im App Store bzw.\nim Google Play Store downloaden.</p>\n<p>Unter dem Men\u00fcpunkt Touren findet Ihr dann die\nSTADTRADELN-R\u00e4tseI\u2014Rallye.</p></div>"

    "072df4cd3a874a50b4d723a754cb9915": {
      "model_name": "HTMLModel",
      "model_module": "@jupyter-widgets/controls",
      "model_module_version": "1.5.0",
      "state": {
        "_dom_classes": [],
        "layout": "IPY_MODEL_4cff356f60064aa699c599d95f1e11e9",
        "style": "IPY_MODEL_016b7411895b4be696ea001138892ff3",
        "value": "\n<style>\nh1 {\n  font-weight: bold;\n  color: #000;\n  font-size: 14px;\n}\n\nh2 {\n  font-weight: bold;\n  color: #000;\n  font-size: 13px;\n}\nh3 {\n  font-weight: bold;\n  color: #000;\n  font-size: 12px;\n}\n</style>\n<div><p>Download: <a href=\"GPX\\R\u00e4tsel-Rallye.gpx\">GPX File</a></p>\n\u003c!-- Farbe: '#00ff80' -->\n\n<h1>R\u00e4tsel Rallye</h1>\n<p>Details zur R\u00e4tsel-Rallye gibt es als <a href=https://umsteigenaufsteigen.de/wp-content/uploads/2020/06/STADTRADELN-R%C3%A4tsel-Rallye.pdf target=\\\"_blank\\\">PDF</a> beim Umweltzentrum Hannover </p>\n<p>Willkommen bei der ersten STADTRADELN-\nR\u00e4tsel-Rallye. Auf euch wartet eine ca. 25 km lange\nRadtour, bei der es Einiges zu entdecken und viele\nAufgaben zu l\u00f6sen gibt. Druckt euch also auf jeden\nFall vor dem Start der Tour unseren R\u00e4tselbogen aus.\nDamit macht die Tour gleich doppelt so viel Spa\u00df und\nbei richtiger L\u00f6sung der Fragen, erwarten euch viele\nwertvolle Sachpreise.</p>\n<p>Habt Ihr den Innenstadtbereich der Landeshauptstadt Hannover schon einmal fast ausschlie\u00dflich im\nGr\u00fcnen umrundet? Diese Tour erm\u00f6glicht euch genau\ndas. Mit vielen Rastm\u00f6glichkeiten eignet sich diese\nTour f\u00fcr die ganze Familie. Unsere R\u00e4tselaufgaben\nsorgen f\u00fcr Abwechslung, auch bei den Kleinen. Wem\ndiese Tour zu lang erscheint, kann Sie auch an\nmehreren Tagen in Teiletappen absolvieren.</p>\n<p>Die L\u00f6sungssumme der STADTRADELN-R\u00e4tsel-Rallye\nschickt ihr bitte bis zum 27.06.2020 per Mail an\ninfo@soulstyle.de. Unter allen Einsendungen werden\n wertvolle Preise verlost.</p>\n<p>\u00dcbrigens: Die Tour Navigation f\u00e4llt besonders leicht\nmit der Bike Citizens Navigations App der Region\nHannover. Diese k\u00f6nnt ihr kostenlos im App Store bzw.\nim Google Play Store downloaden.</p>\n<p>Unter dem Men\u00fcpunkt Touren findet Ihr dann die\nSTADTRADELN-R\u00e4tseI\u2014Rallye.</p></div>"
      }
    },

        "value": "\n<style>\nh1 {\n  font-weight: bold;\n  color: #000;\n  font-size: 14px;\n}\n\nh2 {\n  font-weight: bold;\n  color: #000;\n  font-size: 13px;\n}\nh3 {\n  font-weight: bold;\n  color: #000;\n  font-size: 12px;\n}\n</style>\n<div><p>Download: <a href=\"GPX\\Landwirtschaftspfad.gpx\">GPX File</a></p>\n\u003c!-- Farbe: 'darkgreen' -->\n\n<h1>Der Landwirtschaftspfad Hemmingen</h1>\n<p>Der Landwirtschaftspfad entstand 1998 aus dem Arbeitskreis Landwirtschaft im Rahmen der Lokalen Agenda 21. Der Arbeitskreis setzte sich zusammen aus Landwirten, Planern und Natursch\u00fctzern und hatte zum Ziel, gegens\u00e4tzliche Interessen durch gemeinsame Aktivit\u00e4t zu vereinen.</p>\n<p>Der Pfad ist durchgehend mit gr\u00f6\u00dferen Schildern an Holzpf\u00e4hlen oder vorhandenen Pfosten in zwei Richtungen ausgeschildert. So kann an jeder Stelle und in jede Richtung mit dem Rundweg begonnen werden.\nBis auf ein kleines Wegest\u00fcck ist der Weg befestigt, oft asphaltiert und damit gut befahrbar. Er enth\u00e4lt 20 Stationen, die Sie auf der Hemminger Webseite aufgef\u00fchrt sind.</p>\n<p>30 km langer Rundkurs - mit 20 Stationen</p>\n<p>Quelle: <a href=https://www.stadthemmingen.de/downloads/datei/OTA3MDAxMDE0Oy07L3Vzci9sb2NhbC9odHRwZC92aHRkb2NzL2hlbW1pbmdlbi9oZW1taW5nZW4vbWVkaWVuL2Rva3VtZW50ZS9sYXdpcGZhZF8yMDE0XzA5XzIzX25ldS5wZGY%3D target=\\\"_blank\\\">Stadt Hemmingen</a></p></div>"
